import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const item = props.expensesItem;
  return (
    <ExpenseItem
      title={item.title}
      amount={item.amount}
      date={item.date}
    ></ExpenseItem>
  );
}

export default Expenses;
